_TITLE : "サーバーの管理", TIP_SERVER_SETTINGS_BODY : "サーバーの設定にアクセスするにはここをクリックします。 \n\n権限や役職、音声サーバー地域を選択、AFK チャネルを設定、招待リンクの管理、BANされたユーザーの管理またはサーバーの削除などを変更できます。", TIP_DIRECT_MESSAGES_TITLE : "プライベートチャットの開始", TIP_DIRECT_MESSAGES_BODY : "このリストからサーバにいるすべてのメンバーを見ることができます。\n\nあなたはフレンドを選び、1対1のプライベートチャットをすることが出来ます。\nダイレクトメッセージはAFKであっても通知されるので、何か伝えたい時に最適です。", TIP_CREATE_MORE_SERVERS_TITLE : "サーバーはどこにでもあります!", TIP_CREATE_MORE_SERVERS_BODY : "+ボタンを押してサーバーを構築しましょう！\n\nサーバーの構築は無料なので、必要なだけ構築することが出来ます。各グループ毎にそれぞれのサーバーを割り当てる事ができます。もしサーバーが不要になればサーバーを削除することができます。", TIP_CREATE_FIRST_SERVER_TITLE : "あなたのサーバーを作りましょう", TIP_CREATE_FIRST_SERVER_BODY : "+ボタンを押すことであなたのサーバーを構築する事ができます。\n\nそれぞれのグループ毎にただ一つだけのサーバーを持つことができます。サーバーが不要になった場合はサーバーを消すこともできます。なにより、サーバーが無料なので欲しいだけサーバーを作ることができます。", TIP_FRIENDS_LIST_TITLE : "友人に会いましょう", TIP_FRIENDS_LIST_BODY : "ダイレクトメッセージを表示したい時やあなたのサーバのすべてのユーザーのステータスを見たい時はここをクリックして下さい。\n\nダイレクトメッセージが届いた時は、あなたのアバターの下に表示され、簡単に開くことができます。", BAN_USER_TITLE : "", BAN_USER_CONFIRMED : "", BAN_CONFIRM_TITLE : "'!!{username}!!'よ、Banの鉄槌をくらえ！", FORM_LABEL_DELETE_MESSAGE_HISTORY : "メッセージ履歴を削除", FORM_LABEL_REASON_KICK : "", FORM_LABEL_REASON_BAN : "", FORM_PLACEHOLDER_REASON : "", DELETE_MESSAGE_HISTORY_OPTION_NONE : "いずれも削除しないでください", DELETE_MESSAGE_HISTORY_OPTION_24HR : "過去24時間", DELETE_MESSAGE_HISTORY_OPTION_7D : "過去7日", NO_TEXT : "", YES_TEXT : "", CLOSE : "閉じる", SEND : "送信", CHOOSE : "選択", SAVE : "保存", SELECT : "選択", START : "開始", ADD : "追加する", NEXT : "", DEVICE_SETTINGS : "", ACTIONS : "", SAVE_CONTENT_SUCCESS_MOBILE : "", SAVE_CONTENT_FAILURE_MOBILE : "", SAVE_CONTENT_FAILURE_HELP_MOBILE : "", NO_CAMERA_ACCESS : "Discordがあなたのカメラにアクセスできません。", NO_PHOTOS_ACCESS : "Discordがあなたの写真にアクセスできません。", ENABLE_PRIVACY_ACCESS : "プライバシー設定からアクセスを有効にすることができます。", NO_PHOTO_IN_CAMERA_ROLL : "カメラロールに写真がありません", DELETE_MESSAGE_BODY_MOBILE : "このメッセージを削除してもよろしいですか？削除した場合復元できません。", PIN_MESSAGE_BODY_MOBILE : "このメッセージをピン留めしますか？", JOIN_VOICE_CHANNEL : "このボイスチャンネルに接続しますか？", LEAVE_SERVER_BODY_MOBILE : "", KICK_USER_T